import React from "react";

function Menu() {
    return (
        <>
            <nav>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/sobre">About us</a></li>
                    <li><a href="/contato">Contact</a></li>
                </ul>
            </nav>
        </>
    );
};

export default Menu;
